window.bookSummaryJSON = "<p><b>The floodwaters have receded, and the war is over. A ruler has fallen. The Wind Runner lives, missing yet not forgotten.</b></p> <p>The world is changing, growing larger. After the horrors of war and the loss of spring comes the renewal of summer, a chance for a new beginning.</p> <p>Ryoka Griffin has reappeared in Izril's north. The Quarass is dead, yet the King of Destruction's war continues. In the jungles of Baleros, Geneva and her friends fall under the shadow of the Titan of Baleros. Amidst it all, Erin Solstice grieves for the dead and pulls her family close. Yet there is always a door leading her onwards to a magical future...</p>"; 
